import './App.css';
import About from './components/About/About';
import Announcement from "./components/Announcements/Announcements";
import Bookings from "./components/Bookings/Bookings";
import FooterContact from "./components/Footer/FooterContact";
import Honeycomb from "./components/Honeycomb/Honeycomb";
import Navigation from "./components/Navigation/Navigation";
import React, {Fragment} from 'react';


function App() {
    return (
        <Fragment>
            <Navigation/>

            <body>
            <h1 className={`mainHeader text-dark ff-serif-bold fs-800`}>Welcome to Bee Better Massage </h1>
            <div className='hero'>
                <Bookings/>
                <Honeycomb/>
</div>




            <FooterContact/>

            </body>


        </Fragment>


    )
}

export default App;
